import React from "react";

function Footer()
{
    return (
        <div className="Footer">
        <a href="https://www.linkedin.com/in/kaylea-gray-7277a21b6/"><img class="logo_medium" src="Resources/linkedin.png"/></a>
        <a href="https://www.instagram.com/miss_kaylea_reads/"><img class="logo_small" src="Resources/instagram.png"/></a>
        </div>
    );
}

export default Footer;
